import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';

function HomePage() {
    const navigate = useNavigate();
    const [subspace, setSubspace] = useState(null);

    useEffect(() => {
        // Retrieve the saved subspace from localStorage
        const savedSubspace = JSON.parse(localStorage.getItem('subspace'));
        if (savedSubspace) {
            setSubspace(savedSubspace);
        }
    }, []);

    const handleEdit = () => {
        // Navigate to the edit page (AddSubspacePage)
        navigate('/add-subspace');
    };

    return (
        <div className="home-page">
            <h1>Welcome to HeartViz</h1>
            {subspace ? (
                <div className="subspace-container">
                    <h2>{`Subspace: ${subspace.name}`}</h2>
                    <button onClick={handleEdit}>Edit</button>
                </div>
            ) : (
                <p>No subspace available. Create a new one.</p>
            )}
        </div>
    );
}

export default HomePage;
